import React from "react";
import memedata from "./memedata";


export default function Form(event) {

    return (
        <form>
            <input 
            placeholder="First Name"
            type="text"
            name="firstName"
            // value={forms}
            /> <br />
            <input 
            placeholder="password"
            type="password"
            name="password"
            // value={forms}
            /> <br />
            <input 
            placeholder="confirm password"
            type="text"
            name=""
            // value={forms}
            /> <br />
            <input 
            type="checkbox"
            name="firstName"
            // value={forms}
            />
        </form>
    )
}
